const Content = (props) => {
  let parts = "";
  for (let i = 0; i < props.parts.length; i++) {
    parts =
      parts +
      `<p>
          ${props.parts[i]} ${props.exercises[i]}
        </p>`;
  }
  return <>{parts}</>;
};
export default Content;
